const initState = [
  { id: 1, title: "Kategorija 1" },
  { id: 2, title: "Kategorija 2" },
  { id: 3, title: "Kategorija 3" },
];

const getCategory = (state = initState, action) => {
  switch (action.type) {
    case "GET_CATEGORIES":
      return state;

    default:
      return state;
  }
};
export default isLogged;
